import React, { useState } from 'react';

function App() {
  const [counter, setCounter] = useState(0);
  return (
    <>
      <h1>Current: {counter}</h1>
      <button
        onClick={(counter, setCounter) => {
          setCounter(counter++);
        }}
      >
        Increase
      </button>
    </>
  );
}

export default App;
